import React from 'react'
import ExpenseItem from './ExpenseItem'
const ExpensesList = () => {


  return (
    <div>
         {props.item.length == 0 ? <p>No expenses found</p> : 
         props.item.map((expense) => (
          <ExpenseItem
            key={expense.id}
            title={expense.title}
            amount={expense.amount}
            date={expense.date}
          />
        ))}
    </div>
  )
}

export default ExpensesList
